import React from 'react';

import './Navbar.css';

const Navbar = () => {
    return (
       <div className="navbar">
           <div className="navbar__left">
               <a href="#">Home</a>
               <a href="#">About</a>
               <a href="#">Contact</a>
           </div>
           <div className="navbar__right">
               <a href="#">Login</a>
               <a href="#">Sign Up</a>
           </div>
       </div>
    );
    }

export default Navbar;
